import React, { Fragment } from "react";

const DUMMY_MEALS = [
  {
    id: "m1",
    name: "Sushi",
    description: "Finest fish and veggies",
    price: 22.99,
  },
  {
    id: "m2",
    name: "Schnitzel",
    description: "A german specialty!",
    price: 16.5,
  },
  {
    id: "m3",
    name: "Barbecue Burger",
    description: "American, raw, meaty",
    price: 12.99,
  },
  {
    id: "m4",
    name: "Green Bowl",
    description: "Healthy...and green...",
    price: 18.99,
  },
];

const AvailableMeals = () => {
  return (
    <Fragment>
      <ul>
        <h2> name : {DUMMY_MEALS.name}</h2>
        <h3> description : {DUMMY_MEALS.description}</h3>
        <div> amount: {DUMMY_MEALS.price}</div>
      </ul>
    </Fragment>
  );
};
export default AvailableMeals;
